contracts/destructuring.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

contract DestructuringFunctions {
    uint256 public changeValue;
    string public tom = "Hello!";

    function f()
        public
        pure
        returns (
            uint8,
            bool,
            string memory
        )
    {
        return (3, true, "Bye");
    }

    function g() public {
        (changeValue, , tom) = f();
    }
}

